import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const apiUrl = process.env.REACT_APP_API_URL;

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// –í—ã–≤–æ–¥–∏–º URL API –∏ –ø–æ–¥—Å–∫–∞–∑–∫—É –¥–ª—è –ª–æ–∫–∞–ª—å–Ω–æ–≥–æ –¥–æ—Å—Ç—É–ø–∞
console.log(
  `üåê API —Å–µ—Ä–≤–µ—Ä: ${process.env.REACT_APP_API_URL}\n` +
  `üñ•Ô∏è  –ï—Å–ª–∏ —Ñ—Ä–æ–Ω—Ç–µ–Ω–¥ –∑–∞–ø—É—â–µ–Ω —á–µ—Ä–µ–∑ Vite/CRA, –ø–æ–ø—Ä–æ–±—É–π –∑–∞–π—Ç–∏ —Å –¥—Ä—É–≥–æ–≥–æ —É—Å—Ç—Ä–æ–π—Å—Ç–≤–∞:\n` +
  `http://${new URL(process.env.REACT_APP_API_URL).hostname}:${window.location.port || 3000}`
);
